import "./App.css";
import { Footer } from "./components/Footer";
import { Navbar } from "./components/Navbar";


function App() {

  return (
    <Router>
      <Navbar></Navbar>
      <Routes>
        <Route path="/home" element={<HomePage />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer {...footerInfo}></Footer>
    </Router>
  ); return (
    <Router>
      <Navbar></Navbar>
      <Routes>
        <Route path="/home" element={<HomePage />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer {...footerInfo}></Footer>
    </Router>
  );

}

export default App;
